Plot: Bass player and founding member Steve Harris comments, For The Final Frontier Tour, it was really important to me that we filmed in South America as we re always so overwhelmed by the fans reaction when we go to that part of the world and I wanted to reflect that in the filming. After much consideration, we chose the Santiago show as we felt it was one of our best performances of the entire tour and to play at the prestigious Estadio Nacional was a landmark moment for us. For reasons known to our fans, it took a long time before we got to play our first show in Chile, and once we did get to play a show, the response was so phenomenal we just had to keep coming back, and it s got better and better each time! This show also features the gigantic new Eddie.

